import React from "react";
import "./Topbar.css";
import { Mail } from '@material-ui/icons';

import logo from "../../logo.png";

const Topbar = () => {
  return (
    <div class="topbar">
      <div class="wrapper">
        <div class="left">
          <a href="#intro" class="logo">
            AD
          </a>
              <div class="itemContainer">
                  <Mail style={{ fontSize: "18px", marginRight: "5px" }} />
                  <span>ankit.ad.dhawan@gmail.com</span>
              </div>
        </div>
        <h1>Hello</h1>
        <div class="right">World</div>
      </div>
    </div>
  );
};

export default Topbar;
